          <RegisterInputs />
        </div>
      </div>
      <div className=" mt-1 customRegisterLink ">
        <div className="pointer h-100 d-flex justify-content-center align-items-center fs-4">
          <AiOutlineArrowLeft /> Login
        </div>
      </div>
    </div>
  );
};
